import Container from 'react-bootstrap/Container';
import "bootstrap/dist/css/bootstrap.min.css";
import "../Styles/HomePage.css";
import { Link } from 'react-router-dom'
import React from 'react';


function HomePage() {


    return (
        <>
            <Container  className='d-flex flex-row justify-content-around h-100 introContainer'>
                <div className='d-flex align-items-start  '>
                    para 1 
                </div>
                <div className='d-flex flex-column align-items-center justify-content-center flex-fill mainTitle'>
                    <span>Informatiques</span>
                    <span className='main squeeze'>Creator</span>
                </div>
                <div className='d-flex align-items-end  '>
                    para 3
                </div>
            </Container>
        </>
    );
}

export default HomePage
